// LandingPage.js

import React from 'react';

const LandingPage = () => {
  return (
    <div className="landing-page">
      <nav className="sidebar">
        <h2 className="logo">ERP System</h2>
        <ul className="nav-list">
          <li><a href="#dashboard">Dashboard</a></li>
          <li><a href="#profile">Profile</a></li>
          <li><a href="#projects">Projects</a></li>
          <li><a href="#tasks">Tasks</a></li>
          <li><a href="#reports">Reports</a></li>
          <li><a href="#settings">Settings</a></li>
        </ul>
      </nav>

      <main className="content">
        <header className="header">
          <h1>Welcome to the ERP System</h1>
          <p>Manage your projects, tasks, and reports seamlessly.</p>
        </header>

        <section className="main-section">
          <h2>Dashboard</h2>
          <p>This is the main content area where you can display dashboard widgets or other components.</p>
        </section>
      </main>
    </div>
  );
};

export default LandingPage;
